import "./reset.css";
import "./App.css";
import Home from "./pages/Home";
function App() {
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "./script.js";
    script.async = true;
    document.body.appendChild(script);
    return () => {
      document.body.removeChild(script);
    };
  }, []);
  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
